      0,
      "For the uninitiated, CRDTs [(Conflict-Free Replicated Data \
       types)](https://en.wikipedia.org/wiki/Conflict-free_replicated_data_type) \
       are fancy programming tools which let multiple users edit the same data \
       at the same time. They let you work locally with no lag. (You don't \
       even have to be online). And when you do sync up with other users & \
       devices, everything just magically syncs up and becomes eventually \
       consistent. The best part of CRDTs is that they can do all that without \
       even needing a centralized computer in the cloud to monitor and control \
       everything.\n\n\
       I want Google Docs without google. I want my apps to seamlessly share \
       data between all my devices, without me needing to rely on some [flakey \
       startup](https://ourincrediblejourney.tumblr.com/)'s servers to still \
       be around in another decade.\n\n\
       For text editing they've been famously really slow and clunky for \
       years, so barely anyone uses them. Well, until now.\n" );
